import 'package:petani/Model/petani.dart';

class ApiStatic {
  static Future<List<Petani>> getPetani() async {
    List<Petani> petani = [];
    for (var i = 0; i < 10; i++) {
      petani.add(Petani(
          idPenjual: i,
          nama: "PC" + i.toString(),
          nik: "123" + i.toString(),
          alamat: "Ini Merupakan laptop gaming terbaru dan terbagus",
          telp: "0362",
          foto:
              "data:image/jpeg;base64,",
          idKelompokTani: 1,
          status: "Y",
          namaKelompok: "PC Konektor",
          createAt: "",
          updateAt: ""));
    }
    return petani;
  }
}
